import React from "react";
import "../src/css/wit.css";
function Wit() {
  return (
    <div className="wmain">
      <div className="wbody">
        <div className="wh">WITHDRAW</div>
        <div id="wlabel">THE MINIMUM AMOUNT TO BE WITHDRAW IS <span>20</span></div>
        <input type="number" placeholder="ENTER THE AMOUNT" />
        <button>SUBMIT</button>
      </div>
    </div>
  );
}
export default Wit;
